import React from 'react';
import Recipe from './Recipe.jsx';
import uuid from 'node-uuid';

// Component which contains all recipe data.
class RecipeList extends React.Component {

  //////////////////////////////////////////////////////////////////////////////
  // Component constructor
  //////////////////////////////////////////////////////////////////////////////
  constructor() {
    super();

    // Default picture.
    let defaultPicture = 'data:image/png;base64,';

    // Default list of recipes.
    this.state = {
      recipes: [
        {
          'id': '148e8b2a-c931-4969-a196-0c1fe09671fb',
          'name': 'Buffalo Chicken Mac and Cheese',
          'picture': 'data:image/jpeg;base64,',
          'description': 'I saw my local ballpark was introducing Buffalo chicken mac and cheese and thought it was a great idea!',
          'ingredients': '<div>1 (16 ounce) package elbow macaroni</div><div>1 rotisserie-roasted chicken</div><div>6 tablespoons butter</div><div>6 tablespoons all-purpose flour</div><div>3 cups milk</div><div>1 pinch ground black pepper</div><div>2 cups shredded Cheddar cheese</div><div>2 cups shredded Monterey Jack cheese</div><div>1/2 cup hot sauce</div><div>1/2 cup crumbled gorgonzola cheese</div>',
          'instructions': '<div>1. Bring a large pot of lightly salted water to a boil. Cook macaroni in the boiling water, stirring occasionally until tender yet firm to the bite, 8 minutes. Drain.</div><br/><div>2. Cut wings and legs off rotisserie chicken. Skin and bone wings and legs; chop or shred dark meat into bite-size pieces.</div><br/><div>3. Melt butter in a large Dutch oven over medium heat. Whisk in flour gradually until a thick paste forms. Cook until golden, about 1 minute. Pour in milk, whisking constantly, until thickened and bubbling, about 5 minutes. Continue to cook until sauce is smooth, about 1 minute more. Reduce heat and season sauce with black pepper.</div><br/><div>4. Stir Cheddar and Monterey Jack cheese into the sauce until melted and combined. Stir in hot sauce, adjusting to reach desired level of spiciness. Add blue cheese, chicken, and macaroni; mix well to combine.</div><div></br></div><div>Source: http://allrecipes.com/recipe/245764/buffalo-chicken-mac-and-cheese/</div>'
        },
        {
          'id': 'fd223ceb-c5e6-4ff3-b6a0-3e6c6e26532e',
          'name': 'Lemon Ricotta Pancakes with Blueberry Sauce',
          'picture': 'data:image/jpeg;base64,',
          'description': 'These pancakes are light and don\'t leave you feeling too full.',
          'ingredients': '<div>2 tablespoons lemon juice </div><div>1 tablespoon cornstarch </div><div>2 cups frozen blueberries </div><div>3 tablespoons white sugar </div><div>1 cup ricotta cheese</div><div>2/3 cup milk </div><div>2 eggs </div><div>3 tablespoons white sugar </div><div>1 lemon, juiced and zested </div><div>1/2 teaspoon ground nutmeg </div><div>1/4 teaspoon salt </div><div>1 cup all-purpose flour </div><div>1 tablespoon baking powder</div>',
          'instructions': '<div>1. Mix 2 tablespoons lemon juice and cornstarch together in a bowl until cornstarch dissolves.</div><div><br/></div><div>2. Stir blueberries and 3 tablespoons sugar in a saucepan over medium-high heat. Bring to a boil; reduce heat to low and simmer for 5 minutes. Pour cornstarch mixture into blueberry mixture; cook and stir until mixture thickens slightly. Cover saucepan and remove from heat.</div><div><br/></div><div>3. Whisk ricotta cheese, milk, eggs, sugar, juice from 1 lemon, lemon zest, nutmeg, and salt together in a bowl until well blended. Add flour and baking powder; whisk to combine.</div><div><br/></div><div>4. Heat a lightly oiled griddle or skillet over medium-high heat. Drop batter in 1/4 cup portions onto the griddle and cook until bubbles form and the edges are dry. Flip and cook until browned on the other side. Repeat with remaining batter. Top pancakes with blueberry sauce.</div><div><br/></div><div>Source: http://allrecipes.com/recipe/233914/lemon-ricotta-pancakes-with-blueberry-sauce</div>'
        },
        {
          'id': '914c84da-5e85-40d2-a1ba-dec4a56a1a68',
          'name': 'Best Lemonade Ever',
          'picture': 'data:image/jpeg;base64,',
          'description': 'This is a very refreshing drink!',
          'ingredients': '<div>1 3/4 cups white sugar</div><div>8 cups water</div><div>1 1/2 cups lemon juice</div>',
          'instructions': '<div>1. In a small saucepan, combine sugar and 1 cup water. Bring to boil and stir to dissolve sugar. Allow to cool to room temperature, then cover and refrigerate until chilled.</div><div><br/></div><div>2. Remove seeds from lemon juice, but leave pulp. In pitcher, stir together chilled syrup, lemon juice and remaining 7 cups water.</div><div><br/></div><div>Source: http://allrecipes.com/recipe/32385/best-lemonade-ever</div>'
        }
      ]
    }// end default state.

  }

  //////////////////////////////////////////////////////////////////////////////
  // Function to handle <RecipeList/> state changes
  //
  // Arguments:
  //  id: the recipe id number
  //  key: the field name whose value is to be updated
  //  value: the updated value
  //////////////////////////////////////////////////////////////////////////////
  handleRecipeEdit(id, key, value) {

    // Get a copy of all recipes in the state.
    var recipes = this.state.recipes.slice();

    // Filter recipes and only return the recipe to be updated.
    var result = recipes.filter(function(currentValue, index, arr) {
      return currentValue.id == id;
    })[0];

    // Get the index of the recipe to be updated.
    var idx = recipes.indexOf(result);

    // Modify recipe to with updated data.
    result[key] = value;

    // Replace modified recipe into array.
    recipes[idx] = result;

    // Update state.
    this.setState({
      recipes: recipes
    });

  }

  //////////////////////////////////////////////////////////////////////////////
  // Function to handle recipe deletion.
  //////////////////////////////////////////////////////////////////////////////
  handleRecipeDelete(id) {

    // Get a copy of all recipes in the state.
    var recipes = this.state.recipes.slice();

    // Filter recipes and only return the recipe to be updated.
    var result = recipes.filter(function(currentValue, index, arr) {
      return currentValue.id == id;
    })[0];

    // Get the index of the recipe to be updated.
    var idx = recipes.indexOf(result);

    // Remove recipe at index idx.
    recipes.splice(idx, 1);

    // Update state.
    this.setState({
      recipes: recipes
    });
  }

  addRecipe() {

    // Create a blank recipe.
    var blankRecipe = {
      'id': uuid.v4(),
      'name': 'Untitled',
      'picture': 'data:image/png;base64,',
      'description': 'No description',
      'ingredients': '',
      'instructions': '',
      'startEditable': true
    }

    // Add blank recipe.
    this.setState({
      recipes: this.state.recipes.concat([blankRecipe])
    });

  }

  //////////////////////////////////////////////////////////////////////////////
  // Component render
  //////////////////////////////////////////////////////////////////////////////
  render() {

    // Reference to this component.
    var thisComp = this;

    return (
      <div>

        <div className="row">
          <button
            className="button-add-recipe waves-effect waves-light btn-large"
            onClick={this.addRecipe.bind(this)}>
            <i className="fa fa-plus"></i> Add Recipe
          </button>
        </div>

        <div className="row">
          {this.state.recipes.map(function(element, index) {
            return (
              <Recipe
                recipe={element}
                key={index}
                updateRecipe={thisComp.handleRecipeEdit.bind(thisComp)}
                deleteRecipe={thisComp.handleRecipeDelete.bind(thisComp)}
              />
            )
          })}
        </div>

      </div>
    );
  }

}

export default RecipeList;
